import React from 'react';
import {Dimensions, StyleSheet, Text, View} from 'react-native';
import Svg, {Path} from 'react-native-svg';

const screenHeight = Dimensions.get('window').height;

const BackgroundCurve = ({style}) => {
  return (
    <View style={style}>
      <View style={styles.viewAbove} />
        <Svg height="50%" width="100%" viewBox="0 0 1440 320" style={styles.svg}>
            <Path fill="#FFFFFF" fill-opacity="1" d="M0,128L26.7,128C53.3,128,107,128,160,138.7C213.3,149,267,171,320,181.3C373.3,192,427,192,480,176C533.3,160,587,128,640,106.7C693.3,85,747,75,800,101.3C853.3,128,907,192,960,202.7C1013.3,213,1067,171,1120,138.7C1173.3,107,1227,85,1280,74.7C1333.3,64,1387,64,1413,64L1440,64L1440,0L1413.3,0C1386.7,0,1333,0,1280,0C1226.7,0,1173,0,1120,0C1066.7,0,1013,0,960,0C906.7,0,853,0,800,0C746.7,0,693,0,640,0C586.7,0,533,0,480,0C426.7,0,373,0,320,0C266.7,0,213,0,160,0C106.7,0,53,0,27,0L0,0Z"></Path>
        </Svg>
    </View>
  );
};

export default BackgroundCurve;

const styles = StyleSheet.create({
  viewAbove: {
    backgroundColor: 'white',
    height: screenHeight / 4,
    marginBottom: 70
  },
  svg: {
    top: (screenHeight / 4) -20
  },
});
